But `Quick Start` tab name is not stored as file name in `filePath` here.', 'comment_created': datetime.datetime(2022, 5, 10, 19, 45, 45, tzinfo=datetime.timezone.utc), 'commenter': 'Himanshu40', 'type': 'User'}, {'comment_id': 870764258, 'comment_body': "I have an idea to solve this issue. Instead of freeing the memory of each `documents` after closing the application, should we free each `documents` whenever we close a tab? But this will leads to a change in value for `documentsCount` too because we have to decrement it every time when we close the tab and free the memory. But I saw in comment `// Total number of documents ever opened in application's life time. This is not decreased when closing documents.`", 'comment_created': datetime.datetime(2022, 5, 11, 21, 19, 37, tzinfo=datetime.timezone.utc), 'commenter': 'Himanshu40', 'type': 'User'}, {'comment_id': 875049110, 'comment_body': 'Okay, but only because saveFile() is private.', 'comment_created': datetime.datetime(2022, 5, 17, 16, 48, 21, tzinfo=datetime.timezone.utc), 'commenter': 'drossberg', 'type': 'User'}, {'comment_id': 875066070, 'comment_body': 'Maybe, but this would be something for another PR.', 'comment_created': datetime.datetime(2022, 5, 17, 17, 7, 39, tzinfo=datetime.timezone.utc), 'commenter': 'drossberg', 'type': 'User'}, {'comment_id': 880776037, 'comment_body': "That's logically right, but I don't like the duplicated test of displayGrid. The expressions in the if-clauses give the impression that something complicated is going on there. I recommend to simplify it to
```
if (displayGrid != nullptr) {
    if (displayGrid->getDocument()->getDocumentId() != activeDocumentId) {
        ~
    }
else if (activeDocumentId != -1) {
    ~
}
```
Logically both solutions are the same, but the above describes better that first, the document type is tested (displayGrid != nullptr: BRL-CAD database or something else, i.e. the help page) and then, if something has changed there (another database, activeDocumentId not reset yet), the dependent views will be changed too.", 'comment_created': datetime.datetime(2022, 5, 24, 17, 26, 7, tzinfo=datetime.timezone.utc), 'commenter': 'drossberg', 'type': 'User'}, {'comment_id': 880783605, 'comment_body': 'So `activeDocumentId != -1` is enough to check if the tab is `Quick Start` or not.', 'comment_created': datetime.datetime(2022, 5, 24, 17, 34, 56, tzinfo=datetime.timezone.utc), 'commenter': 'Himanshu40', 'type': 'User'}]

